import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Locate the first product card and its "Add to Cart" button
    const firstProductCard = page.locator('.product-card').first();
    const addToCartButton = firstProductCard.locator('button.add-to-cart');

    // Verify the button is visible before clicking
    await addToCartButton.waitFor({ state: 'visible' });

    // Get initial cart state
    const initialCartText = await page.locator('.cart').textContent();
    const initialCartCount = parseInt(initialCartText.trim().split('\n')[0]);

    // Take a screenshot before adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the "Add to Cart" button on the first product
    await addToCartButton.click();

    // Wait for the cart count to update. The JS updates the DOM.
    await page.waitForFunction(
      (expectedCount) => {
        const cartElement = document.querySelector('.cart');
        if (!cartElement) return false;
        const currentCount = parseInt(cartElement.textContent.trim().split('\n')[0]);
        return currentCount === expectedCount;
      },
      initialCartCount + 1
    );

    // Take a screenshot after adding to cart, showing the updated cart icon
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Extract data to verify the task was completed
    const updatedCartText = await page.locator('.cart').textContent();
    const updatedCartCount = parseInt(updatedCartText.trim().split('\n')[0]);

    const cartDataFromStorage = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonCart'));
    });

    const extractedData = {
      initialCartCount,
      updatedCartCount,
      firstItemInCart: cartDataFromStorage.length > 0 ? cartDataFromStorage[0] : null
    };

    if (updatedCartCount !== 1 || extractedData.firstItemInCart.id !== 1) {
        throw new Error('Verification failed: Cart was not updated correctly.');
    }

    return {
      success: true,
      action: "Added the first product to the cart and verified the cart count updated.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
